❗️Все российские студенты, обучающиеся в зарубежных вузах и сталкивающиеся с ущемлением своих прав, могут вернуться в Россию и продолжить свое обучение в ведущих вузах страны:

▪️Московский государственный университет им. М.В. Ломоносова;

▪️Санкт-Петербургский государственный университет;

▪️Высшая школа экономики (ВШЭ);

▪️Московский инженерно-физический институт (МИФИ);

▪️Московский физико-технический институт (МФТИ);

▪️Московский государственный технический университет им. Н.Э. Баумана;

▪️Санкт-Петербургский политехнический университет Петра Великого.

⚡️Заявления Минфина:

— В бюджете есть ресурсы для выполнения социальных обязательств в текущих условиях. Государство выполнит все социальные обязательства в полном объеме, сказал Силуанов;

— при необходимости будут приняты меры по докапитализации банков;

— Минфин заявил, что подготовил предложение о проведении более масштабной амнистии капитала.

