⚡️В состав украинской делегации вошли:

• министр обороны Резников;

• замглавы МИД Точицкий;

• советник главы офиса президента Подоляк;

• глава фракции "Слуга народа" Арахамия;

• депутат Умеров;

• первый замглавы украинской делегации в трехсторонней контактной группе Костин.

#вечернийтелеграм_спецоперация

⚡️Зеленский записал новое обращение:

• Армия России идёт на штурм;
• Зеленский заявил, что договорился с мировыми лидерами о новой значительной помощи Украине;
• Нужно сделать всё, чтобы остановить эту агрессию. Каждый день агрессия — эта агрессия везде, не только в Украине, но и в России, во всей Европе.

#вечернийтелеграм_спецоперация

❗️Главное о российской военной спецоперации к этому часу:

🔺ВС РФ взяли под контроль ряд населённых пунктов Херсонской области, заявили в региональной администрации;

🔺 Россия в результате ударов вывела из строя 74 наземных объекта военной инфраструктуры Украины, в том числе 11 аэродромов ВВС, три командных пункта, пункт базирования ВМС и 18 радиолокационных станций, сообщает Минобороны РФ;

🔺в ходе российской операции были сбиты боевой вертолёт и четыре ударных беспилотника Bayraktar TB2;

🔺 в ведомстве добавили, что украинские пограничники «никакого сопротивления не оказывают»;

🔺 в ДНР 14 военнослужащих ВСУ сдались в плен;

🔺 при этом в МВД ДНР заявили, что гарантируют безопасность украинским полицейским в Донбассе, которые откажутся работать на Киев;

🔺 в ЛНР сообщили, что в результате атак уничтожены 19 единиц техники, три миномётных взвода и до двух рот личного состава ВСУ;

🔺 украинские депутаты обратились к Зеленскому с просьбой начать незамедлительные переговоры с Россией;

🔺Лавров заявил, что Россия всегда будет готова к диалогу, который вернёт всех к справедливости и принципам Устава ООН.

#вечернийтелеграм_спецоперация

Владимир Зеленский выступил с обращением по поводу признания Россией независимости ЛНР и ДНР. Главное:

🔹 Признание независимости ЛНР и ДНР означает односторонний выход РФ из минских соглашений;

🔹 Действия РФ являются нарушением территориальной целостности Украины;

🔹 Международные признанные границы Украины останутся такими же;

🔹 Киев стремится к миру дипломатией, оставляя право на самооборону;

🔹 Зеленский инициировал экстренное заседание «Нормандской четверки».

⚡️Заседание Совбеза по ситуации в Донбассе. Главное:

▪️Путин заявил, что сегодня примет решении по вопросу о признании ЛНР и ДНР;

▪️Медведев: «Признание ДНР и ЛНР — единственный выход для Москвы, если ситуация в Донбассе и дальше будет идти по такому же пути, как сейчас»;

▪️Нарышкин: «Надо дать Западу последний шанс, чтобы он заставил Киев выполнить Минские соглашения»;

▪️Патрушев призвал поддержать обращение Госдумы о признании независимости ДНР и ЛНР;

▪️Лавров поддержал решении о признании: «Не вижу другого пути, 2-3 дня ничего не изменят»;

▪️Мишустин: «Власти РФ давно ведут подготовку к возможной реакции на признание ЛНР и ДНР, эти риски хорошо проработаны»;

▪️Матвиенко: «Для Украины — это территория, для России — это люди <...> Я полагаю, что пришло время принимать решение»

▪️Шойгу: «У Украины есть оборудование, технологии и специалисты для создания ядерного оружия. Планы Украины вернуть статус ядерной страны опасны».
